r = n - 1
mn = 1
mx = n
while 0 == 0:
    if l >= r:
        print(-1)
        break
    elif a[l] == mn or a[l] == mx:
        if a[l] == mn:
            mn += 1
        if a[l] == mx:
            mx -= 1
        l += 1
    elif a[r] == mn or a[r] == mx:
        if a[r] == mn:
            mn += 1
        if a[r] == mx:
            mx -= 1
        r -= 1
    else:
        print(l + 1, r + 1)
        break

