            check_compile_issues(program_a, IssueCode.E_Undefined)

            program_b = RplTestProgram(
                additional_sources=[
                    "actor EmptyActor;",

                    f"""\
                    module Messages;
                    import EmptyActor;
                    {expression_testing.ENUM_TYPE_ALIAS}
                    message SendMessage contains {t};
                    """,

                    """
                    actor MyActor;
                    import Messages;
                    on SendMessage(s, d) {
                        send WaitMessage(d) >> s;
                    }
                    """,
                ],
                test_actor_imports="""\
                import EmptyActor;
                import Messages;
                import MyActor;
                """,
                test_actor_contents=f"""\
                var myactor = create MyActor();
                {expression_testing.ENUM_TYPE_ALIAS}
                {expression_testing.EMPTY_ACTOR_VARIABLES}
                """,
                main_body=f"""\
                send SendMessage({v}) >> myactor;
                var result = wait WaitMessage << myactor;
                """
            )
            check_compile_issues(program_b, IssueCode.E_Undefined)

    def test_a_4_declared_unmatched_name_matched_type(self):
        # Requirement: RPL-MSG-D01
        "Verifies declared message with non-matching name and matching data type leads to CTE E_Undefined."
        for t, v in expression_testing.ALL_TYPES_VALUES_EXAMPLES.items():

            program_a = RplTestProgram(
                additional_sources=[
                    "actor EmptyActor;",

                    f"""\
                    module Messages;
                    import EmptyActor;
                    {expression_testing.ENUM_TYPE_ALIAS}
                    message SendMessage contains {t};
                    """,

                    """
                    actor MyActor;
                    import Messages;
                    on SendMessage(s, d) {}
                    """,
                ],
                test_actor_imports="""\
                import EmptyActor;
                import Messages;
                import MyActor;
                """,
                test_actor_contents=f"""\
                var myactor = create MyActor();
                {expression_testing.ENUM_TYPE_ALIAS}
                {expression_testing.EMPTY_ACTOR_VARIABLES}
                """,
                main_body=f"""\
                send SendMessageNew({v}) >> myactor;
                """
            )
            check_compile_issues(program_a, IssueCode.E_Undefined)

            program_b = RplTestProgram(
                additional_sources=[
                    "actor EmptyActor;",

                    f"""\
                    module Messages;
                    import EmptyActor;
                    {expression_testing.ENUM_TYPE_ALIAS}
                    message SendMessage contains {{}};
                    message WaitMessage contains {t};
                    """,

                    f"""\
                    actor MyActor;
                    import Messages;
                    import EmptyActor;
                    {expression_testing.ENUM_TYPE_ALIAS}
                    {expression_testing.EMPTY_ACTOR_VARIABLES}
                    on SendMessage(s, d) {{
                        send WaitMessage({v}) >> s;
                    }}
                    """,
                ],
                test_actor_imports="""\
                import EmptyActor;
                import Messages;
                import MyActor;
                """,
                test_actor_contents=f"""\
                var myactor = create MyActor();
                {expression_testing.ENUM_TYPE_ALIAS}
                {expression_testing.EMPTY_ACTOR_VARIABLES}
                """,
                main_body="""\
                send SendMessage >> myactor;
                var result = wait WaitMessageNew << myactor;
                """
            )
            check_compile_issues(program_b, IssueCode.E_Undefined)

    def test_a_5_declared_matched_name_unmatched_type(self):
        # Requirement: RPL-MSG-D01
        "Verifies declared message with matching name and non-matching data type leads to CTE E_Undefined."
        for (t2, v2), (t1, _) in product(
                expression_testing.ALL_TYPES_VALUES_EXAMPLES.items(),
                expression_testing.ALL_TYPES_VALUES_EXAMPLES.items()):
            if t2 == t1 or (t2, t1) in expression_testing.IMPLICITLY_CASTABLE_TYPES_PAIRS:
                continue

            program_a = RplTestProgram(
                additional_sources=[
                    "actor EmptyActor;",

                    f"""\
                    module Messages;
                    import EmptyActor;
                    {expression_testing.ENUM_TYPE_ALIAS}
                    message SendMessage contains {t1};
                    """,

                    """
                    actor MyActor;
                    import Messages;
                    on SendMessage(s, d) {}
                    """,
                ],
                test_actor_imports="""\
                import EmptyActor;
                import Messages;
                import MyActor;
                """,
                test_actor_contents=f"""\
                var myactor = create MyActor();
                {expression_testing.ENUM_TYPE_ALIAS}
                {expression_testing.EMPTY_ACTOR_VARIABLES}
                """,
                main_body=f"""\
                send SendMessage({v2}) >> myactor;
                """
            )
            check_compile_issues(program_a, IssueCode.E_TypeCastError)

            program_b = RplTestProgram(
                additional_sources=[
                    "actor EmptyActor;",

                    f"""\
                    module Messages;
                    import EmptyActor;
                    {expression_testing.ENUM_TYPE_ALIAS}
                    message SendMessage contains {{}};
                    message WaitMessage contains {t1};
                    """,

                    f"""\
                    actor MyActor;
                    import EmptyActor;
                    import Messages;
                    {expression_testing.ENUM_TYPE_ALIAS}
                    {expression_testing.EMPTY_ACTOR_VARIABLES}
                    on SendMessage(s, d) {{
                        send WaitMessage({v2}) >> s;
                    }}
                    """,
                ],
                test_actor_imports="""\
                import EmptyActor;
                import Messages;
                import MyActor;
                """,
                test_actor_contents=f"""\
                var myactor = create MyActor();
                {expression_testing.ENUM_TYPE_ALIAS}
                {expression_testing.EMPTY_ACTOR_VARIABLES}
                """,
                main_body="""\
                send SendMessage >> myactor;
                var result = wait WaitMessage << myactor;
                """
            )
            check_compile_issues(program_b, IssueCode.E_TypeCastError)

    def test_a_6_declared_unmatched_name_unmatched_type(self):
        # Requirement: RPL-MSG-D01
