    def test_success_cases(self):
        self.collect_cases_a_1_declared_matched_name_matched_type()
        check_success_cases({f"case_{num}": case for num, case in enumerate(self.success_case_programs, start=1)})


class TestMessageOther:
    def test_message_undefined(self):
        # Requirement: RPL-MSG-COMM03
        program = RplTestProgram(
            additional_sources=[
                """\
                module DeclaredMessages;
                message TestMsg contains str;
                """,
                """\
                actor Receiver;
                """
            ],
            test_actor_imports="""\
            import Receiver;
            import DeclaredMessages;
            """,
            test_actor_contents="var receiver = create Receiver();",
            main_body='send TestMsg("Hi") >> receiver; Testing.complete();'
        )
        check_compile_issues(program, IssueCode.E_Undefined)

    def test_message_ingnored(self):
        # Requirement: RPL-MSG-COMM03
        program = RplTestProgram(
            additional_sources=[
                """\
                module DeclaredMessages;
                message TestMsg contains str;
                message TriggerWait contains {};
                """,
                """\
                actor Receiver;
                import DeclaredMessages;

                on TriggerWait(sender, data)
                {
                    discard wait TestMsg;
                    // assert here
                }

                """
            ],
            test_actor_imports="""\
            import Receiver;
            import DeclaredMessages;
            """,
            test_actor_contents="var receiver = create Receiver();",
            main_body='send TestMsg("Hi") >> receiver; Testing.complete();'
        )
        check_compile_success(program)
        check_run_result(program)

